(23630, 11044, 0, 1, 'fighting(2009年版)', '去年某日看完赤璧這部片後,想寫首帶點古中國風的曲子,剛好kb手Nara的本行是演奏古箏,就順道在這首歌裡加了古箏;此曲除了大幅降低了電子音效的比例,也是新任主唱晶晶入團後的首次錄音作品\r\n\r\n如果喜歡此曲的話,也煩請推薦給你的朋友吧~謝謝\r\n\r\n請加入舞璃的facebook社團,有表演活動/新曲發表 我們將在第一時間通知您~\r\nhttp://www.facebook.com/home.php?sk=lf#!/group.php?gid=149002139284&ref=ts\r\n\r\n舞璃其他的試聽網頁:http://www.myspace.com/crystdancer\r\nor  http://tw.beta.streetvoice.com/music/Crystaldancer/', '2010-03-22 00:00:00', 0000, 5, 0, 9, '', '', 277, '', 'Deth', '晶晶', 'Deth', '', '', 0, 0, 0, '2010-03-22 14:37:54', '2015-03-12 13:41:53', '0000-00-00 00:00:00'),
(23631, 10292, 0, 1, '馬德里羅曼史 Madrid Romance', 'Madrid Romance\r\n\r\n這是一首 陳浩2010  最具代表性的作品\r\n內斂與狂野的多樣風格\r\n搭配獨特的編曲\r\n\r\n獨樹一格的 陳浩吉他嗓音風格\r\n樹立了獨樹一格的氛圍\r\n\r\n深刻聆聽\r\n即能感受\r\n這首歌的無限魅力\r\n\r\n\r\n現在免費公開搶聽 趕快把握機會!!', '2010-03-18 00:00:00', 0000, 50, 0, 1, '', '', 205, '', '陳浩 Xhen How', '陳浩 Xhen How', '陳浩', 'XhenHowMusic', '', 0, 1, 0, '2010-03-22 14:53:34', '2015-03-12 13:41:53', '0000-00-00 00:00:00'),
