(23646, 57530, 2462, 2, 'If It''s Not You', '', '2007-03-01 00:00:00', 2000, 25, 0, 5, '', 'I see you standing over there\nWhy won''t you come on over\nThe way things work seems so unfair\nI''m drunk but you''re still sober\nI wasted time on silly things\nI''ve never felt my own way\nI used to dream of wedding rings\nI never felt my own so\n\nBut if I can''t have you\nI know what to do\nI know where to go\nTo get over you\nIf it''s not you (x4)\n\nI''ve seen you holding hands with her\nYou told me it was over\nI thought that you were just good friends\nI''ve seen the way you hold her\nDon''t waste your time\nShe''s not your type\nI need to get my say in\nShe''s been with all the boys I know\nI know the games she''s playing\n\nBut if I can''t have you\nI know what to do\nI know where to go\nTo get over you\nIf it''s not you (x4)\n\nI''ve heard it all a million times please take me back I miss you\nStill you don''t seem to understand I''ve lost the will to kiss you\nBut still you''ll take me in your arms\nSend shivers down my spine\nShe''s not afraid that nothings changed\nShe''s not your ideal love now\n\nBut if I can''t have you\nI know what to do\nI know where to go\nTo get over you\nIf it''s not you (x4)', 188, '', '', '', '', '', '', 1, 1, 0, '2010-03-22 20:08:08', '2015-03-12 13:41:53', '0000-00-00 00:00:00'),
