(23672, 57531, 2464, 10, 'Malibu U.', '', '2005-05-01 00:00:00', 2000, 25, 0, 5, '', 'Sunshine Malibu, \nFun time Malibu, \nMalibu U\n\nThere''s a school where the students all major in fun, \nStudying the sun\nIt''s called Malibu U \nMalibu U, Malibu U\n\nClasses meet on the grooviest beach by the sea, \nTuition is free\nDown at Malibu U \nMalibu U, Malibu U\n\nAt old M. U. you can earn a degree in riding surfboards\nBikini bunnies and surfers who see come to\nStudy sunmanship \nPractice funmanship malibu\n\nAll new students report to the dean at the school \nHis office is cool\nIt''s a telephone booth, \nTelephone booth, Malibu U\n\nHe will tell you to work just as hard as you can, \nGetting a tan\nDown at Malibu U \nMalibu U, Malibu U\n\nAt old M.U. you can earn a degree in lookin groovie\nThe school''s the greatest you know what I mean\nWhen you study funmanship \nPractice sunmanship\n\nAt old M.U. you can earn a degree in feelin'' groovie\nSchools the greatest you know what I mean\nWhen you study sunmanship \nPractice funmanship\nStudy funmanship \nPractice sunmanship\n\nWake up get ready, have fun, \nLets go study\nWake up get ready, \nHave fun, \nLets go steady\n\nMore lyrics: http://www.lyricsmania.com/malibu_u_lyrics_harpers_bizarre.html\nAll about Harpers Bizarre: http://www.musictory.com/music/Harpers+Bizarre', 205, '', '', '', '', '', '', 1, 1, 0, '2010-03-23 02:19:20', '2015-03-12 13:41:54', '0000-00-00 00:00:00'),
