(23675, 1476, 2463, 1, 'If We Could Still Be Together', '', '2010-03-23 00:00:00', 2010, 0, 1, 6, '張大了眼，漸漸腐敗的明天\r\n空氣之間，微微傾圮的世界\r\n\r\n彼此了解，我們只用另一種\r\n加速墜落，刺人的鋒利\r\n令人洩氣的冷血\r\n\r\n荒唐的像場戲劇結尾\r\n蹣跚朝向前 無可救藥的對你執著要你理解\r\n但其實我們有些改變\r\n調整了姿態，把過去記得更清\r\n彼此才能再度擁抱\r\n\r\nIf we could still be together\r\n小心翼翼將它包裹著\r\n用憂傷又得意的方式將你我輕柔豢養\r\n\r\nIf we could still be together\r\n無所不容將美好收藏\r\n有深刻又神祕的夢境\r\nwe would still be together\r\n\r\n\r\n\r\n\r\n閉上了眼，再看不見聽不見\r\n從沒有過，令人厭煩的煩厭\r\n\r\n彼此困惑，生活周遭的一切\r\n先從聊天，長繭的爭執\r\n不作聲的沉默\r\n\r\n荒唐的像場戲劇結尾\r\n蹣跚朝向前 無可救藥的對你執著要你理解\r\n但其實我們有些改變\r\n調整了姿態，把過去記得更清\r\n彼此才能再度擁抱\r\n\r\nIf we could still be together\r\n小心翼翼將它包裹著\r\n用憂傷又得意的方式將你我輕柔豢養\r\n\r\nIf we could still be together\r\n無所不容將美好收藏\r\n有深刻又神祕的夢境\r\nwe would still be together', '', 313, '', '', '', '', '', '', 0, 0, 1, '2010-03-23 06:24:06', '2013-10-07 17:16:08', '0000-00-00 00:00:00'),
