(23677, 1476, 2463, 2, 'The Last Day of Us', '', '2010-03-23 00:00:00', 2010, 0, 1, 5, 'You know that I won''t go\r\ni''m so hooked by you\r\nlittle winking at me\r\n\r\nYou know that I won''t know\r\ni''m so desperate\r\nto be with you so real so true\r\n\r\nholding tightly\r\n(holding hands)\r\nwith my heart\r\nthe lonely and lovely\r\n\r\nwhat if all that is true\r\nrealizing that i need you\r\nremember the night we drove on the road\r\neven though I can''t be there\r\nyou don''t know where I''ve been\r\ncalling names seems to be more close\r\n\r\nYou sang the song that i wrote\r\ntaking the pills for cure\r\nStreaming down, the blood from your nose\r\nsaying don''t worry me\r\nread the lines you copied\r\n"I''m so glad that I can met you before i die"', '', 294, '', '', '', '', '', '', 0, 0, 1, '2010-03-23 06:33:20', '2013-10-07 17:16:08', '0000-00-00 00:00:00'),
