(23704, 57706, 2467, 4, '窮人賣屎忽', '', '2009-11-01 00:00:00', 2000, 25, 0, 7, '', '世界經濟絕望　窮人賣屎忽救香港\n我們的積蓄都已大解放\n幫人做音樂最適當\n\n我們都不是收很貴\n我們都很等錢駛\n器材上亦甘願花駛費\n是要令客人覺得抵', 44, '', '', '', '', '', '', 1, 1, 0, '2010-03-23 16:34:48', '2015-03-12 13:41:55', '0000-00-00 00:00:00'),
(23705, 57706, 2467, 5, '社會主義青年', '', '2009-11-01 00:00:00', 2000, 25, 0, 7, '', '基本上我只是一個隱蔽的青年\n如果你決定要和我發展\n我們也許不會經常見\n如果見　我也只會帶你流浪到海邊\n然之後告訴你我的一個重點\n我的重點是我沒有錢\n所以先至帶你到海邊\n\n基本上我經已不算是一個青年\n而且我都不適合表演\n這一點也應該很明顯\n表演時不知望向邊\n表演時不知應該望向邊\n\n基本上我是一個傾向社會主義的青年\n雖然馬克思的共產黨宣言只看過一遍\n但世界需要改變\n不要讓我失業超過半年', 143, '', '', '', '', '', '', 1, 1, 0, '2010-03-23 16:35:20', '2015-03-12 13:41:55', '0000-00-00 00:00:00'),
