(23713, 57706, 2467, 10, '失業抗爭歌', '', '2009-11-01 00:00:00', 2000, 25, 0, 7, '', '來到世上的意義是為了抗衡\n為了正義必要時犯法抗爭\n這是場戰爭但勝利是不可能\n犯法為彰顯法制不公允\n\n全世界也在欺壓著社會低下層\n年過五十低技能無法翻身\n大財團最終亦會炒哂你D人\n小政府唔會理你幾窮困\n\n來到最後只有最後的搖滾精神\n我們有四五六七八九十個人\n這是場戰爭但勝利是不可能\n犯法為彰顯法制不公允', 117, '', '', '', '', '', '', 1, 1, 0, '2010-03-23 16:38:59', '2015-03-12 13:41:55', '0000-00-00 00:00:00'),
