(23722, 57706, 2468, 8, '你的微笑像朵花', '', '2005-11-01 00:00:00', 2000, 25, 0, 7, '', '你的微笑像朵花\n\n已經過了兩星期，沒有與你食雪梨。\n我與你確實離奇，年紀相差五十里。\n那天你要去外地，剩下我獨自皺眉，\n你的個性最迷離，讓我不可以忘記。\n願明日能再見，你迷人的嘴臉。\n我現時就快要，找你對住我笑。\n你知嗎？你最迷人，是你回望那帶笑的眼神。\n那刻已被你迷魂，為了你甘願受困。\n可惜我另有愛人，實在讓我最頭暈，\n怎可以共你蜜運？望你可給我熱吻。\n願明日能再見，你迷人的嘴臉，\n我現時就要叫，想起你就要跳', 158, '', '', '', '', '', '', 1, 1, 0, '2010-03-23 16:43:01', '2015-03-12 13:41:56', '0000-00-00 00:00:00'),
