(23726, 57706, 2467, 16, 'donald tsang, please die', '', '2009-11-01 00:00:00', 2000, 25, 0, 7, '', 'Donald Tsang, please die.　我地實上街\nDonald Tsang, please die. When will you be fired?\n假設Donald今日你俾人斬咗只手\n二十年後果個人發咗達又做埋特首\n你會否因為佢既成就　然後叫自己不要追究\nDonald Tsang, please die.　我地實上街\nDonald Tsang, please die. We''re all poor guys.\n\n董建華雖然做野系渣\n但系良心都唔會好似你咁差\n你任內最驕人既成就\n就系強化市民對民主既要求\n\nDonald Tsang, please die. When will you die?\nDonald Tsang, please die. When will you be fired?', 114, '', '', '', '', '', '', 1, 1, 0, '2010-03-23 16:45:01', '2015-03-12 13:41:56', '0000-00-00 00:00:00'),
