(23728, 57706, 2469, 2, '在動物園散步才是正經事', '', '2007-03-01 00:00:00', 2000, 25, 0, 7, '', '我間中仍會想我們會見面，在那間紅磡近黃埔的商店。\n你若然還記得那諾言，曾說今天我們流浪到海邊。\n你照片留在一封情信裡面，每一天仍是照舊看它一遍。\n我仍然還記得那笑臉，曾在當天我們遊玩過夏天。\n我都曾寫你在每天的日記，但放棄你卻像再沒可能夢想，像一個沉悶的獨唱。\n你照片留在一封情信裡面，每一天仍是照舊看它一遍。\n兩年前遊過的動物園，來到今天我們流浪到那邊?\n我都曾寫你在每天的日記，但放棄你卻像再沒可能夢想，像一個沉悶的獨唱。\n但放棄你卻像再沒可能夢想，像失去甜蜜的合唱。', 135, '', '', '', '', '', '', 1, 1, 0, '2010-03-23 16:48:39', '2015-03-12 13:41:56', '0000-00-00 00:00:00'),
